import React from 'react';
import { createMuiTheme, withStyles, makeStyles, ThemeProvider } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { green, blue, purple } from '@material-ui/core/colors';
import ButtonBase from '@material-ui/core/ButtonBase';
import Avatar from '@material-ui/core/Avatar';
import Noteworthy from '../fonts/Noteworthy-Lt.woff';
import CssBaseline from '@material-ui/core/CssBaseline';
import '../App.css';

const noteworthy = {

  fontFamily: 'Noteworthy Light',
  fontStyle: 'normal',
  fontDisplay: 'swap',
  fontWeight: 'normal',
  src: `
    local('Noteworthy Light'),
    url('../fonts/Noteworthy-Lt.woff') format('woff')
  `,
  unicodeRange:
    'U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF',
};



const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    color: "black",
    marginLeft: 10,
  },
  image: {
    height: 50,
    width:50
  }
}));

const image =
  {
    url: '/assets/H2R.png',
    title: 'Breakfast',
    width: '100%',
  }


export default function NavBar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" style={{ background: "#ffffff" }}>
        <Toolbar>
          <Button>
            <Avatar variant="square" src="/assets/H2R.png"  />
          </Button>
          <div class="titleNav">
          <h1>
            How2React
          </h1>
          </div>
          <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
    </div>
  );
}
